import React from 'react';

const Input = (props) => {
	const element =
		props.element === 'input' ? (
			<input id={props.id} type={props.type} placeholder={props.placeholder} />
		) : (
			<textarea rows={props.rows || 3} />
		);
	return <div></div>;
};

export default Input;
